import React, { useEffect, useState } from 'react'
import { Link } from 'react-router-dom';
import { Header } from 'semantic-ui-react';

export default function Characters() {
  const [characters, setCharacters] = useState([])

  useEffect(() => {
    fetch('/api/v1/posts')
      .then(res => res.json())
      .then(data => {
        setCharacters(data);
      })
  }, [])



  return (
    <div>
      {characters === [] && <Header as='h2'>You've not created a character yet. Shall we <Link to='/races'>Thorge</Link> one?</Header>}
    </div>
  )
}
